The Latinas Acting Up first mental health and wellness event – “BUBBLES & SoundBath“ was a HIT!! An evening of cleansing, re-centering, and relaxation followed by amazing catering and celebration!! We look forward to doing many more of these health and wellness meet ups in the future with our Hermanas. Thank you to all those who donated to our event, your generosity made our evening that much more beautiful.  To our Soundbath guide @thrivewithjulia and our Cacao Ritual leader @sofiajyepes THANK YOU for sharing your talent and energy with us… It was truly a gift!! And a ginormous GRACIAS to our LAU TEAM for all their tireless work and enthusiasm!! Until next time!!! 🧘🏽‍♀️✨💕
